import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import SignUp from "./Pages/Signup";
/**
 * ?  =====Import Components=====
 */
import Home from "./Pages/Home";

function App() {
  return (
    <div>
      <Router ex>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/signup">
          <SignUp />
        </Route>
      </Router>
    </div>
  );
}

export default App;
